import React from 'react';

function App() {
  return (
    <div>
      <header>
        <h1>Welcome to Tennis Coaching</h1>
      </header>
      <main>
        <section className="coaches">
          <h2>Our Coaches</h2>
          {/* Coach list will go here */}
        </section>
        <section className="booking">
          <h2>Book a Session</h2>
          {/* Booking form will go here */}
        </section>
      </main>
    </div>
  );
}

export default App;
